import React, { useState } from 'react';
import Sidebar from '../components/Sidebar';
import EmotionDetector from '../components/EmotionDetector';

const Dashboard = ({ onNavigate, dark, onToggleMode }) => {
  const [sidebarOpen, setSidebarOpen] = useState(false);

  return (
    <div className="max-w-6xl mx-auto">
      <div className="lg:hidden mb-4">
        <button onClick={() => setSidebarOpen(true)} className="px-3 py-2 rounded bg-indigo-600 text-white">â˜° Menu</button>
      </div>

      <div className="grid grid-cols-1 lg:grid-cols-4 gap-6">
        <div className="col-span-1 hidden lg:block">
          <Sidebar onNavigate={onNavigate} onLogout={() => onNavigate('home')} dark={dark} onToggleMode={onToggleMode} open={true} />
        </div>

        <div className="col-span-3">
          <div className="bg-white/5 p-4 rounded-lg">
            <h2 className="text-2xl font-semibold mb-3">Live Detection</h2>
            <EmotionDetector />
          </div>
        </div>
      </div>

      <Sidebar onNavigate={onNavigate} onLogout={() => onNavigate('home')} dark={dark} onToggleMode={onToggleMode} open={sidebarOpen} onClose={() => setSidebarOpen(false)} isOverlay={true} />
    </div>
  );
};

export default Dashboard;
